import React from 'react';
import { Card, CardContent, CardActions, TextField, Button, Typography } from '@mui/material';
import Grid from '@mui/material/Grid2';
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';



export default function Login(){
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const handleLogin = (event) => {
        if (username === 'kelly' && password === '123456') {
            navigate('/home'); // Redirect to /home if credentials match
          } else {
            alert('Invalid username or password!');
            navigate('/'); // Redirect back to the login page or wherever necessary
          }
    };

    return (
        <Grid container justifyContent="center" alignItems="center" style={{ height: '100vh', backgroundColor: '#1976d2'}}>
        <Card sx={{ maxWidth: 400, padding: 2 }}>
            <Typography variant="h5" component="div" gutterBottom align="center">
            Login
            </Typography>
            <CardContent>
            <form onSubmit={handleLogin}>
                <TextField
                fullWidth
                margin="normal"
                label="Username"
                variant="outlined"
                required
                value={username} 
                onChange={(e) => setUsername(e.target.value)}
                />
                <TextField
                fullWidth
                margin="normal"
                label="Password"
                type="password"
                variant="outlined"
                required
                value={password} 
                onChange={(e) => setPassword(e.target.value)}
                />
                <CardActions sx={{ justifyContent: 'center' }}>
                <Button type="submit" variant="contained" color="primary">
                    Login
                </Button>
                </CardActions>
            </form>
            </CardContent>
        </Card>
        </Grid>
    );
}
